const Dashboard = () => {
    return (
        <div className="min-h-screen bg-black">
        <h1 className="text-green-300 font-bold text-3xl p-3">StockSure</h1>
        <div className="flex flex-col items-center justify-center">
            <h1 className="text-green-300 font-bold text-3xl p-3">Dashboard</h1>
            <p className="text-green-300 font-bold text-3xl p-3">Welcome to StockSure</p>
            </div>
            <div className="flex item-center justify-center mb-5">
            <input type="text" placeholder="Enter Stock Symbol: Eg: AAPL" />
            </div>
        </div>
    )
    }

export default Dashboard;
